    [],nt"revision_timestamp": "2016-07-27T22:51:36.235118",nt"name": "hydrogeomorphic-evaluation-of-ecosystem-restoration-and-management-options-for-dale-bumper",nt"isopen":
    false,nt"url": null,nt"notes": "Dale Bumpers White River National Wildlife
    Refuge (DBWRNWR) contains one of the largest contiguous tracts of bottomland hardwood
    forested (BLH) wetlands in the Mississippi Alluvial Valley. However, the area has
    been greatly altered and influenced by water and navigation structures on the White,
    Arkansas, and Mississippi rivers along with local and regional land, water, and
    forest uses. These influencing factors have impacted plant and animal populations
    on the refuge in many ways, and contemporary ecological conditions are modified
    from pre-settlement periods. Information was obtained on historical and contemporary
    geology and geomorphology, soils, topography, climate and hydrology, and plant and
    animal communities. The historical and more contemporary changes to the DBWRNWR
    region, and specific refuge lands, are chronicled in this report including discussion
    of early settlement and land use changes, contemporary hydrologic and vegetation
    community changes, and refuge development and past management. Specific recommendations
    to address and support restoration and management goals are provided in this report.",nt"license_title":
